    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1949. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical development and plantings.
    Resource management is outlined; topics include grazing and timber harvesting. The
    public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, and violations. N-R forms are attached.",nt"license_title":
